import React from 'react';
import {Carousel,ListView} from 'antd-mobile';
import './publish.css';
import add from '../../images/add.png';
export default class Publish extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            typeList: [],
            activeType: 0,
            productList: [],
            bannerList: [],
        }
    }
    render(){
        return(
            <div className="cm-mlr-15">
                <div>
                    <textarea name="" id="" cols="30" className="cm-width-full publish-textarea" rows="10" placeholder="描述商品转手原因，入手渠道和使用感受"></textarea>
                </div>
                <div className="publish-photo-box">
                    <img src={add} alt="" className="publish-photo"/>
                    <div className="cm-mt-05">请上传照片</div>
                </div>
                <div>
                    <div className="cm-fw-bold cm-c-333">价格与分类</div>
                    <div>
                        <label htmlFor="">价格</label><input type="text"/>
                        <label htmlFor="">分类</label><input type="text"/>
                    </div>
                </div>
                <div className="cm-btn">确认发布</div>
            </div>
        )
    }
}
